paper.install(window);

const COLOR = {
  'red' : '#FF0000',
  'blue' : '#0000FF',
  'black' : '#000000',
  'orange': '#FFA500',
  'green' : '#008000',
  'cyan':'#00FFFF',
  'magenta': '#FF00FF',
  'yellow' : '#FFFF00',
  "transparent": false
};

const Mode = {
  tutorial: 0,
  design: -1,
  project1:1,
  project2:2,
  project3:3

};


var Project = function( mode){
  this.holes = [];
  this.designGraphs = [];
  this.progress = -1;
  this.workingCanvas = null;
  this.gameMode = mode;
  this.saved = null;
  this.JSON = null;
  this.cutting = [];
  this.etching = [];
  this.rastering = [];
  if(mode!=Mode.design){
    this.progress = 0;
  }

  var DesignGraph = function(size, scale){
    this.size = size;
    this.scale = scale;
  }

  switch(this.gameMode) {
    case Mode.tutorial:
     this.designGraphs.push(new DesignGraph({w: 11, h:5}, 3));
    break;
    case Mode.project1:
      this.designGraphs.push(new DesignGraph({w: 11, h:5}, 1));
    break;
    case Mode.project2:
      this.designGraphs.push(new DesignGraph({w: 7, h:7}, 0.6));
      break;
    case Mode.project3:

    break;
  }

}

Project.prototype.designInit = function(){
  var proj = this;

  var d = getDesign(this.gameMode, this.progress);
  $.each(d, function(k,v){
    var p;
    switch (v.type) {
      case 'path':
          p = paperU.transformPath(v.d, v.options, v.name);
        break;
      case 'circle':
         p = paperU.transformCircle(v.cx, v.cy,v.r, v.options, v.name);
      break;
      case 'rect':
        p = paperU.transformRect(v.x,v.y,v.width, v.height, v.options, v.name);
        console.log(p);
        console.log(p.isInside(view.bounds));
      break;
    }

    var scal = proj.designGraphs[proj.progress].scale;
    p.scale(scal, new Point(0,0));



    proj.workingCanvas.addChild(p);
    switch (v.func) {
      case "cutting":
      proj.cutting.push(p);
      break;
      case "etching":
      proj.etching.push(p);
      break;
      case "rastering":
      proj.rastering.push(p);
      break;
    }
  })
  proj.workingCanvas.position=view.center;
}

Project.prototype.setUpCanvas = function (width, height){
  $("#DesignCanvasContainer").empty();
  var cs=$("<canvas id='designCanvas' style='height:"+(height*100)+"px; width:"+(width*100)+"px'></canvas>");
  cs.css({
    "top": 0,
    "bottom":0,
    "left" :0,
    "right":0,
    "margin": "auto",
    "background": "white"
  });

  $("#DesignCanvasContainer").append(cs);

  paper.setup('designCanvas');
  this.workingCanvas = new Group();
}

Project.prototype.saveDesign = function(project){
  this.saved = project.exportSVG();
  this.JSON = project.exportJSON({asString: false});
}


